	tfm.exec.addImage("17e937f4f5a.png","?1",-900,1500,name,20,1,0,1)
end
function eventLoop(p,f)
	if mode == "fly" then
		loop=loop+1
	end
	if f < 1000 then
		rodar()
		mode="building"
	end
	if p > 120000 then
		if mode == "building" then
			mode="fly"
		end
		for n,player in pairs(tfm.get.room.playerList) do
			if player.y < 125 and f < 255000 and mode=="fly" then
				tfm.exec.giveCheese(n)
				tfm.exec.playerVictory(n)
				mode="ending"
			end
			if dragon == true and player.y < 488 and data[n].reached == false and not tfm.get.room.playerList[n].isDead then
				data[n].reached=true
				data[n].message=data[n].message+1
				if data[n].message == 1 then
					showMessage("<VP>Nada causa tanta admira√ß√£o quanto a beleza das estrelas...<br><ROSE>‚Äî Aurelion Sol",n)
					data[n].message=-10
				end
			end
		end
	end
	if p > 123000 and p < 123650 then
		showMessage("<R>Tempo esgotado! Est√° na hora de voar!<br><ROSE><b>Aten√ß√£o! Objetos voadores est√£o caindo do c√©u!</b>")
		for n,player in pairs(tfm.get.room.playerList) do
			tfm.exec.attachBalloon(n,false)
			if tfm.get.room.playerList[n].isShaman then
				tfm.exec.setShaman(n,false)
			end
		end
	end
	if p > 123651 and p <= 150000 then
		tfm.exec.addShamanObject(objects1[math.random(#objects1)], math.random(-400,2000), 1, 0, 0, 0, false)
		loop=0
	end
	if p > 150000 and p <= 200000 then
		for i=1,2 do
			tfm.exec.addShamanObject(objects2[math.random(#objects2)], math.random(-400,2000), 1, 0, 0, 0, false)
			loop=0
		end
	end
	if p > 200000 and p <= 250000 then
		for i=1,2 do
			tfm.exec.addShamanObject(objects3[math.random(#objects3)], math.random(-400,2000), 1, 0, 0, 0, false)
			loop=0
		end
	end
	if p >= 250000 then
		for i=1,3 do
			tfm.exec.addShamanObject(objects4[math.random(#objects4)], math.random(-400,2000), 1, 0, 0, 0, false)
			loop=0
		end
	end
end
